import React from 'react';
import './Testimonials.css';

const doctors = [
  {
    name: 'Dr. John Doe',
    specialization: 'Cardiologist',
    experience: '15 Years',
    image: require('../../../assets/HomePage/testimonials/doctor1.jpg')
  },
  {
    name: 'Dr. Jane Smith',
    specialization: 'Dermatologist',
    experience: '10 Years',
    image: require('../../../assets/HomePage/testimonials/doctor2.jpg')
  },
  {
    name: 'Dr. David Wilson',
    specialization: 'Neurologist',
    experience: '12 Years',
    image: require('../../../assets/HomePage/testimonials/doctor3.jpg')
  },
  {
    name: 'Dr. Lisa Adams',
    specialization: 'Pediatrician',
    experience: '8 Years',
    image: require('../../../assets/HomePage/testimonials/doctor4.jpg')
  },
  {
    name: 'Dr. Michael Brown',
    specialization: 'Orthopedic Surgeon',
    experience: '18 Years',
    image: require('../../../assets/HomePage/testimonials/doctor5.jpg')
  },
  {
    name: 'Dr. Emma White',
    specialization: 'Psychiatrist',
    experience: '9 Years',
    image: require('../../../assets/HomePage/testimonials/doctor6.jpg')
  }
];

const Testimonials = () => {
  return (
    <div className="testimonials-section">
      <h2 className="testimonials-title">Our Expert Doctors</h2>
      <div className="doctors-row">
        {doctors.map((doctor, index) => (
          <div key={index} className="doctor-card">
            <img src={doctor.image} alt={doctor.name} className="doctor-image" />
            <h3>{doctor.name}</h3>
            <p>{doctor.specialization}</p>
            <p>{doctor.experience}</p>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Testimonials;
